fn my_first_interpreter(code: &str) -> String {
    let mut output = String::new();
    let mut acc: u8 = 0;
    for cmd in code.chars() {
        if cmd == '+' {
            acc = acc.wrapping_add(1);
        } else if cmd == '.' {
            output.push(acc as char);
        }
    }
    output
}

